import React from 'react';
import './App.css';
import mainPic from './466F17BB-45C1-460B-9415-F1427BD8C142_1_105_c.jpeg'

function App() {
  return (
    <div >
        <div className='navbar'>
          <h5 style={{fontSize: '48px'}}>Matthew & Jenafer</h5>
          <ul>
            <li>Home</li>
            <li>Schedule</li>
            <li>Photos</li>
            <li>FAQ's</li>
            <li>RSVP</li>
          </ul>
        </div>
        <img className='mainPic' src={mainPic} alt= 'MattJena' />
        <h4 className='centerText padding'>Jenafer Morton <br/> and <br/> Matthew Rodriguez</h4>
        <h1 className='centerText padding'>ayyaya</h1>
        <h1 className='centerText padding'>ayyaya</h1>
        <h1 className='centerText padding'>ayyaya</h1>
    </div>
  );
}

export default App;
